import React, { useEffect, useState } from 'react';
import axios from "axios";
import { useDispatch } from "react-redux";
import CreateBreedModal from './CreateBreedModal';
import { getDogs, getTemperaments } from '../../redux/actions';

const Form = () => {
  const dispatch = useDispatch();

  const [temps, setTemps] = useState([]); // temps = [{id:1, name: 'Alert'},{},{}]
  const [selectedTemp, setSelectedTemp] = useState('');
  const [input, setInput] = useState({
    name: "",
    min_height: "",
    max_height: "",
    min_weight: "",
    max_weight: "",
    life_span: "",
    temperament: "",
    image: "",
  });
  const [showModal, setShowModal] = useState({ created: false, temp: false });

  useEffect(() => {
    const getTemps = async () => {
      const response = await axios.get('/temperament');
      setTemps(response.data);
    };
    getTemps();
  }, []);

  const handleChange = (ev) => {
    setInput({
      ...input,
      [ev.target.name]: ev.target.value,
    });
  };

  const handleSubmit = (ev) => {
    ev.preventDefault();
    axios.post("/dog", input).then((res) => {
      if (res.status === 200) {
        setShowModal({
          ...showModal,
          created: true
        })
        dispatch(getDogs())
        setInput({
          name: '',
          weight: '',
          height: '',
          life_span: '',
          temperaments: []
        });
      }
    })
    .catch(() => {
      setShowModal({
        ...showModal,
        temp: true
      })
    })
  };

  const handleChangeTemp = (ev) => {
    setSelectedTemp(ev.target.value);
    if (ev.target.value) {
      if (!input.temperaments.includes(ev.target.value)) {
        setInput({
          ...input,
          temperaments: [...input.temperaments, ev.target.value]
        })
      }
    }
  };

  function getNames(arr) {
    let names = [];
    temps.forEach((t) => {
      arr.forEach((id) => {
        if (parseInt(id) === t.id) {
          names.push({ id: t.id, name: t.name })
        }
      })
    })
    return names;
  }

  const deleteTemp = (id) => {
    setInput({
      ...input,
      temperaments: input.temperaments.filter(temp => parseInt(temp) !== id)
    })
  }
    return (

        <div
        >
            <CreateBreedModal setShowModal={setShowModal} showModal={showModal} />
            <div className='form'>

                <h1>Create Breed</h1>
                <form className='form-top' id='form-top' onSubmit={handleSubmit}>

                    <input
                        required
                        name='name'
                        type='text'
                        value={input.name}
                        placeholder='Name'
                        onChange={handleChange}
                    />
                    <input
                        required
                        name='weight'
                        type='number'
                        value={input.weight}
                        placeholder='Weight'
                        onChange={handleChange}
                        min="1"
                    />
                    <input
                        required
                        name='height'
                        type='number'
                        value={input.height}
                        placeholder='Height'
                        onChange={handleChange}
                        min="1"
                    />
                    <input
                        required
                        name='life_span'
                        type='number'
                        value={input.life_span}
                        placeholder='Life span'
                        onChange={handleChange}
                        min="1"
                    />

                    <select onChange={handleChangeTemp} name="temperaments" value={selectedTemp}  >
                        <option value=''>Select temperaments</option>
                        {
                            temps.map((t) => (
                                <option value={t.id} key={t.id}>{t.name}</option>
                            ))
                        }
                    </select>
                    <div className='temp-container'>
                        <div>
                            {
                                getNames(input.temperaments).map((t) => (
                                    <div
                                    >
                                        {t.name} <button onClick={() => deleteTemp(t.id)}><i className="fas fa-times"></i></button>
                                    </div>
                                ))
                            }
                        </div>
                    </div>

                    <input className='submit' type="submit" value='Create' />

                </form>
            </div>

            {/* <img src="https://images.unsplash.com/photo-1537151625747-768eb6cf92b2?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=632&q=80" alt="" /> */}

            <div className='img-container' />


        </div>
    )

}


export default Form;
